import React from 'react';
import { PortHead } from './components/header';
import { Link } from 'react-router-dom';

import Vimeo from '@u-wave/react-vimeo';
import { Main, Img } from './components/components';

export const Yape = () => (
	<main>
		<PortHead />
		<Main>
		<Vimeo
			video="https://vimeo.com/387650908"
			width="680px"
			responsive
		/>
		<Img src="../img/yape/yapetype.jpg" class="w-70 mt6" />
			<img src="../img/yape/yapetype.jpg" className="w-70 mt6" />
		</Main>
	</main>
);
